"value":0.1},"fill_color":{"value":"orange"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"orange"},"line_alpha":{"value":0.1},"line_color":{"value":"orange"},"size":{"value":8},"x":{"field":"x"},"y":{"field":"y"}},"id":"1133","type":"Circle"},{"attributes":{"coordinates":null,"data_source":{"id":"1064"},"glyph":{"id":"1065"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1067"},"nonselection_glyph":{"id":"1066"},"view":{"id":"1069"}},"id":"1068","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"value":5},"x":{"field":"Month"},"y":{"field":"Nombre_passagers"}},"id":"1073","type":"Circle"},{"attributes":{"children":[{"id":"1594"},{"id":"1592"}]},"id":"1595","type":"Column"},{"attributes":{"children":[{"id":"1085"},{"id":"1599"}]},"id":"1600","type":"Row"},{"attributes":{"text":"&lt;h1&gt; Les reseaux de transport en Bretagne&lt;/h1&gt;\n&lt;h2&gt;Ibrahim SOILAHOUDINE - Nabil LOUDAOUI - Yann KIBAMBA&lt;/h2&gt;\n&lt;p&gt;La r\u00e9gion Bretagne, situ\u00e9e \u00e0 l'ouest de la France, est une r\u00e9gion qui dispose d'un r\u00e9seau de transport bien d\u00e9velopp\u00e9. Elle offre diff\u00e9rents moyens de transport pour les d\u00e9placements locaux et internationaux. Pour ce projet nous avons donc d\u00e9cider de porter un regard sur les diff\u00e9rents moyens de transport de la r\u00e9gion, aussi bien maritime que terrestre.&lt;/p&gt;\n&lt;p&gt;Pour cela, on a utilis\u00e9 plusieurs bases de donn\u00e9es de data.bretagne.bzh.&lt;/p&gt;\n&lt;p&gt;Ce sont les suivantes: trafic-ferries.csv, compteurs-cyclistespietons.csv et arrets-ferroviaires.csv&lt;/p&gt;\n&lt;p&gt;Ci-dessous, la repr\u00e9sentation des chiffres du trafic ferries des ports de Roscoff et Saint-Malo en fonction des ann\u00e9es.&lt;/p&gt;"},"id":"1596","type":"Div"},{"attributes":{},"id":"1583","type":"BasicTickFormatter"},{"attributes":{"children":[{"id":"1597"}]},"id":"1599","type":"Column"},{"attributes":{"text":"Via ce graphique interractive en cliquant sur les ann\u00e9es dans la l\u00e9gende, on remarque tous d'abord que le nombre de passagers augmente fortement lors de la p\u00e9riode estivale avec un pic. De 2017 \u00e0 2019, le nombre de passagers est d'environ 250 000. Le graphique permet de remarquer la forte chute en 2020 d\u00fb \u00e0 la crise sanitaire. 2021 et 2022 montre le regain de passagers mais reste encore un peu loin du nombre passagers de la fin des ann\u00e9es 2010."},"id":"1598","type":"Div"},{"attributes":{"text":"&lt;img src=\"https://static.actu.fr/uploads/2019/08/salamenca-960x640.jpg\" width=500&gt;"},"id":"1597","type":"Div"},{"attributes":{},"id":"1584","type":"AllLabels"},{"attributes":{},"id":"1577","type":"UnionRenderers"},{"attributes":{"children":[{"id":"1603"},{"id":"1606"}]},"id":"1607","type":"Column"},{"attributes":{},"id":"1586","type":"CategoricalTickFormatter"},{"attributes":{},"id":"1578","type":"Selection"},{"attributes":{"text":"&lt;h1&gt; Compteurs cyclistes et pi\u00e9tons&lt;/h1&gt;\n&lt;h3&gt;D\u00e9velopp\u00e9 par la soci\u00e9t\u00e9 \u00e9co-compteur, la technologie \u00ab Eco-MULTI \u00bb permet de mesurer la fr\u00e9quentation par des capteurs. Cette technologie install\u00e9 dans diff\u00e9rentes communes de bretagne a enregistr\u00e9 le trafic de pi\u00e9ton et de v\u00e9lo que nous avons repr\u00e9senter ci-dessous.&lt;/h3&gt;\n&lt;p&gt; Carte interactif repr\u00e9sentant pour chaque ville les trafics de v\u00e9los et pi\u00e9tons, en cliquant sur chaque point. &lt;/p&gt;"},"id":"1603","type":"Div"},{"attributes":{"callback":null,"tooltips":[["Axe de train","@axe"]]},"id":"1277","type":"HoverTool"},{"attributes":{"label":{"value":"2022"},"renderers":[{"id":"1068"}]},"id":"1070","type":"LegendItem"},{"attributes":{"text":"&lt;img src=\"https://www.lorientbretagnesudtourisme.fr/uploads/2019/05/e.-lemee-balade-la-voie-verte-59-jpeg-1024x683.jpg\" widt
